import { Component } from "react";

class DestinationData extends Component{
    render() {
        return (
            <div className="first-des">
                <div className="des-text">
                    <h2>{this.props.heading}</h2>
                    <p>One of the most iconic views in Luzon, Mt Taal boats a volcano inside a lake inside an island, if you fancy a closer look, the hike up to the crater is a mere 45 minutes, and is easy enough for beginners. Guides will assist youmost at the way, and you'll see the peculiar environment found on an active volcano including volcanic rocks and steam vents. The unwind with some heading back home!                </p>
                </div>
                <div className="des-img">
                    <img alt='img1' src='https://images.unsplash.com/photo-1583878594798-c31409c8ab4a?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8bW91bnRhaW4lMjB3aXRoJTIwbGFrZXxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=1000&q=60' />
                    <img alt='img2' src='https://images.unsplash.com/photo-1629575839282-89036f85d5ff?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTd8fG1vdW50YWluJTIwd2l0aCUyMGxha2V8ZW58MHx8MHx8&auto=format&fit=crop&w=1000&q=60' />
                </div>
            </div>
        )
    }
}

export default DestinationData;
